import React from 'react'

import logements from '../../assets/logements.json'
import Carrousel from '../../components/Carrousel'
import starTrue from '../../assets/starTrue.svg'
import starFalse from '../../assets/starFalse.svg'
import styled from 'styled-components'

const FicheLogement = styled.div`
  width: 1440px;
`

const LogementsProprietaires = styled.div``

function Fiche() {
  /*Récupération de la fiche dans les données JSON */

  /*Idem pour les Rates */

  return (
    <Fiche>
      return (
      <FicheLogement>
        {logements.map((logement) => {
          return <Carrousel key={logement.id} picture={logement.pictures} />
        })}

        <LogementsProprietaires></LogementsProprietaires>
      </FicheLogement>
      )
    </Fiche>
  )
}
export default Fiche
